Plot:Cristina Carver (Angelica Maria) finds herself in dire straits after she arrives to spend some time with her TV-reporter husband (Dean Stockwell) who is visiting a Latin American country run by a military dictator. After a car accident one day, Cristina brings the helpful Col. Kostik (Donald Pleasence) home and then kills him in self-defense when he violently attempts to rape and murder her. Terrified, she covers up her act and hides the body, yet in spite of her husband's efforts to protect her, a local police detective starts to figure out what really happened.

